import React from 'react';

import HomeStyle from './HomeStyle';
import { withStyles } from '@material-ui/core'; // npm install @material-ui/styles
import Button from '@material-ui/core/Button';
import Container from '@material-ui/core/Container';



const Home = props => {
        const { classes } = props;

return(
        <>
        <Container style={classes.containerHome} maxWidth="lg" >
                        <div style={classes.blockGauche}>
                                <p style={classes.intro}>Bienvenue ! <br /> Je m'appelle Marie Thielens <br /> et je suis web developer.</p>
                                <p style={classes.gris}>Front End Developper / React / Wordpress</p>
                                <Button style={classes.bouton} variant="outlined">Venez voir mon travail</Button> 
                        </div>
                        <div>
                                <img style={classes.newMarieImage} src="../../img/NewSuperMarie.png" alt="Logo super Marie" />
                        </div>
        </Container>
        </>
)
}
export default withStyles(HomeStyle)(Home);
